import React, { Component } from 'react';

const Action = (props) => {
    const {movies,delmovie,fullheart}=props;
        return (
            <React.Fragment>
                <table className="table">
                    <thead>
                        <tr>
                            <th scope="col">MOVIE'S NUMBER</th>
                            <th scope="col">NAME</th>
                            <th scope="col">GENRE</th>
                            <th scope="col">RATING</th>
                            <th scope="col">LIKE? SAVE!</th>
                            <th scope="col">DELETE</th>
                        </tr>
                    </thead>
                    <tbody>
                        {movies.map( movie => <Movie1 movieHeart={movie.heart} Key={movie.id} movieId={movie.id} movieName={movie.name} movieGenre={movie.genre} movieRating={movie.rating} delmovie={(id)=>delmovie(movie.id)} fullheart={(id)=>fullheart(movie.id)} />)}
                    </tbody>
                </table>    
            </React.Fragment>
        );
    }    

export default Action;
